import React, {Component} from 'react';
import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';
// import Geocode from "react-geocode";
// import {fetchCountryData} from './api'
import countryLoc from './Country'

const mapStyles = {
  width: '80%',
  height: '70%',
};

export class MapContainer extends Component {
  constructor(props) {
    super(props);
    // this.state = { 
      // stores: [{latitude: 56.1304, longitude: -106.3468},
      //         {latitude: 39.8283, longitude: -98.5795},
      //         {latitude: 33.93911, longitude: 67.709953},
      //         {latitude: 61.5240, longitude: 105.3188}]
    // }
  }

  displayMarkers = () => {
    return this.state.stores.map((store, index) => {
      return <Marker 
        key={index} 
        id={index} 
        position={{
          lat: store.latitude,
          lng: store.longitude
     }}
     onClick={() => console.log("You clicked me!")} />
    })
  }

  render() {
    return (
        <Map
          google={this.props.google}
          zoom={1}
          style={mapStyles}
          initialCenter={{ lat: 39.8283, lng: -98.5795}}
        >
          {this.displayMarkers()}
          {/* <Marker
            lat={39.8283}
            lng={-98.5795}
            name="My Marker"
            color="red"
          /> */}
        </Map>
    );
  }
}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyCW_Vioa3QR3TUnN6MuFdprCqabI055FZk'
})(MapContainer);
